import React, { Component, Fragment } from "react";
import { Layout } from "antd";

const { Content } = Layout;
export default class Dish extends Component {
  render() {
    return (
      <Fragment>
        <Content style={{ margin: "2em 16px" }}></Content>
      </Fragment>
    );
  }
}
